import { useState } from "react";
import CommentDisplayComponent from "../../../Day 05/my-app/src/components/listandkeys/CommentDisplayComponent";
import { useEffect } from "react";

const ListAndKeysComponent = () => {
    const[comments, setComments]= useState([
        {
            "userId": 1,
            "id": 1,
            "title": "delectus aut autem",
            "completed": false
        },
        {
            "userId": 1,
            "id": 2,
            "title": "quis ut nam facilis et officia qui",
            "completed": false
        },
        {
            "userId": 1,
            "id": 3,
            "title": "fugiat veniam minus",
            "completed": false
        }
    ])
    const handleDelete=(id)=>{
        const newComment=comments.filter(comment=>comment.id!==id);
        setComments(newComment);
    }

    const[name,setName]=useState("Jasdhir")

    useEffect(()=>{
        console.log("use effect called ....")
    },[name])

    return (
        <>
        <h2>List and Keys</h2>
        <CommentDisplayComponent comments={comments} handleDelete={handleDelete}/>
        <button onClick={()=>setName('Andrew')}>Change Name</button>
        </>
    );
}
export default ListAndKeysComponent;
